import React from 'react';
import Hero from './Hero';
import Wipes from './Wipes';
import AOS from 'aos';
import Footer from './Footer';
import Product from './Product';
import { ParallaxProvider, Parallax } from 'react-scroll-parallax';

const Home = () => {
  AOS.init()
  return (
    <ParallaxProvider>
      <Hero />
      <Wipes />
      {/* <Product /> */}
      {/* <Footer /> */}
      <Product />
    </ParallaxProvider>
  );
}

export default Home;
